script: |
  super -f text -I q10426.spq | sort > q10426.out

inputs:
  - name: q10426.spq
    data: |
      SELECT + col0 + col1 AS col2 FROM tab2 (FORMAT parquet) WHERE - + col1 * col0 + + col1 * 63 NOT IN ( + ( - - col1 ) );
  - name: tab2

outputs:
  - name: q10426.out
    data: |
      141
      142
      97
